import React, { useContext, useEffect } from 'react';
import { Store } from './Store';

const MapScreen = () => {
  const { state, dispatch: ctxDispatch } = useContext(Store);

  useEffect(() => {
    ctxDispatch({
      type: 'SET_FULLBOX_ON',
    });
  }, [ctxDispatch]);

  return (
    <div className="full-box">
      <div className="container"></div>
    </div>
  );
};

export default MapScreen;
